#include <iostream>
int main(int argc, char** argv) {
std::cout << "Hello, World!" << std::endl;
return 0;
}
Оператор << для объекта cout (тип которого - класс ostream) является так называемым перегруженным оператором вывода. Более подробно эта тема будет освещена позже. Сейчас же достаточно знать, что этот оператор отвечает за то, чтобы складывать в поток вывода то, что находится справа от него (по сути это метод, аргументом которого является правая часть). Оператор >> в свою очередь последовательно выкладывает из потока ввода данные в указанные справа переменные.
В общем целом оператором называется символ (или набор символов), применяющий некую операцию к некоему количеству объектов. Объекты, к которым применяется оператор, называются операндами.
В C++ операторы могут быть унарными (работают с одним операндом), бинарными (два операнда) и тернарными (три операнда).
Ex.
a + b -> a и b операнды, + - оператор сложения
a++ -> a операнд, ++ - оператор инкрементации (прибавление единицы)
